import React, { useState } from "react";
import universityData from "./universityData";
import jsPDF from "jspdf";
import "jspdf-autotable";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState(null);
  const [selectedSubject, setSelectedSubject] = useState("");
  const [selectedProgram, setSelectedProgram] = useState("Bachelors");

  const handleExportPDF = () => {
    const doc = new jsPDF();
    doc.text("University Details", 14, 10);

    if (
      selectedUniversity &&
      selectedSubject &&
      selectedUniversity.subjectDetails[selectedSubject]
    ) {
      const data = selectedUniversity.subjectDetails[selectedSubject][selectedProgram];
      const rows = [
        ["QS Rankings (Last 5 Years)", data.qsRankingsOverYears.join(", ")],
        ["Start Date", data.startDate],
        ["Fees", data.fees],
        ["GPA Cutoff", data.gpaCutoff],
        ["SAT Cutoff", data.satCutoff],
        ["Eligibility (International)", data.eligibility.International],
        ["Eligibility (Domestic)", data.eligibility.Domestic],
        ["Course Link", data.courseLink]
      ];
      doc.autoTable({ head: [["Field", "Value"]], body: rows });
      doc.save("university-details.pdf");
    }
  };

  const subjects =
    selectedUniversity?.subjectDetails || {};
  const programs = ["Bachelors", "Masters", "PhD"];

  return (
    <div style={{ padding: 20 }}>
      <h1>QS University Rankings Explorer</h1>

      <div>
        <label>Select University: </label>
        <select
          onChange={(e) => {
            const uni = universityData.find(
              (u) => u.name === e.target.value
            );
            setSelectedUniversity(uni);
            setSelectedSubject("");
            setSelectedProgram("Bachelors");
          }}
        >
          <option value="">--Choose--</option>
          {universityData.map((uni, index) => (
            <option key={index} value={uni.name}>
              {uni.name}
            </option>
          ))}
        </select>
      </div>

      {selectedUniversity && (
        <>
          <div style={{ marginTop: 10 }}>
            <label>Select Subject: </label>
            <select
              value={selectedSubject}
              onChange={(e) => setSelectedSubject(e.target.value)}
            >
              <option value="">--Choose--</option>
              {Object.keys(subjects).map((subject, index) => (
                <option key={index} value={subject}>
                  {subject}
                </option>
              ))}
            </select>
          </div>

          {selectedSubject && (
            <>
              <div style={{ marginTop: 10 }}>
                <label>Select Program: </label>
                <select
                  value={selectedProgram}
                  onChange={(e) => setSelectedProgram(e.target.value)}
                >
                  {programs.map((prog, index) => (
                    <option key={index} value={prog}>
                      {prog}
                    </option>
                  ))}
                </select>
              </div>

              <div style={{ marginTop: 20 }}>
                <h2>
                  {selectedSubject} - {selectedProgram}
                </h2>
                <p>
                  <strong>QS Rankings (Last 5 Years):</strong>{" "}
                  {
                    selectedUniversity.subjectDetails[selectedSubject][
                      selectedProgram
                    ].qsRankingsOverYears.join(", ")
                  }
                </p>
                <p>
                  <strong>Start Date:</strong>{" "}
                  {
                    selectedUniversity.subjectDetails[selectedSubject][
                      selectedProgram
                    ].startDate
                  }
                </p>
                <p>
                  <strong>Fees:</strong>{" "}
                  {
                    selectedUniversity.subjectDetails[selectedSubject][
                      selectedProgram
                    ].fees
                  }
                </p>
                <p>
                  <strong>GPA Cutoff:</strong>{" "}
                  {
                    selectedUniversity.subjectDetails[selectedSubject][
                      selectedProgram
                    ].gpaCutoff
                  }
                </p>
                <p>
                  <strong>SAT Cutoff:</strong>{" "}
                  {
                    selectedUniversity.subjectDetails[selectedSubject][
                      selectedProgram
                    ].satCutoff
                  }
                </p>
                <p>
                  <strong>Eligibility (International):</strong>{" "}
                  {
                    selectedUniversity.subjectDetails[selectedSubject][
                      selectedProgram
                    ].eligibility.International
                  }
                </p>
                <p>
                  <strong>Eligibility (Domestic):</strong>{" "}
                  {
                    selectedUniversity.subjectDetails[selectedSubject][
                      selectedProgram
                    ].eligibility.Domestic
                  }
                </p>
                <p>
                  <strong>Course Link:</strong>{" "}
                  <a
                    href={
                      selectedUniversity.subjectDetails[selectedSubject][
                        selectedProgram
                      ].courseLink
                    }
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    View Course
                  </a>
                </p>
                <button onClick={handleExportPDF}>Export to PDF</button>
              </div>
            </>
          )}
        </>
      )}
    </div>
  );
}

export default App;
